export interface Values {
  firstName: string;
  lastName: string;
  email: string;
  paso: number;
    arr: Array<{
		lbl1: Array<{lbl1:{};}>;
    }>;
}
export interface Stl {
	[index:number]:Array<{
		propi:string;
		valor:string;
		}>;
	}
/*
interface defItem {
  [index: string]: defItemDeta;
}
