  label4: string;
  label5: string;
  label6: string;
  label7: string;
  label8: string;
  label9: string;
  label10: string;
  label11: string;
}*/

interface Props {
  onSubmit: (values: Values) => void;
}

export const MyForm: React.FC<Props> = ({ onSubmit }) => {
	const estilo1 = {
      color: "white",
      "z-index": "1"
    };
	const fondoIMG= {
		color: "white",
		"max-width": "90vw",
		"max-height": "90vh",
		width: "90%",
		"z-index": "-1",
		backgroundImage:url(fondo)
    };
	const leftContainer= {
		color: "white",
		"font-size":"10px"
    };
  return (
  <div className="Row">
  <div className="col s12" >
  <div className="Col S6">
  <Grid container >
  <Grid container item xs={1}>
  </Grid>
  
  <Grid container item xs={10}>
  <Grid container style={leftContainer} item xs={7}>
  <img src={fondo} style={fondoIMG}/>
<p style={estilo1} >Seguro de </p>
