  <p>Hasta S/. 12 millones de cobertura anual</p>
  <p>Mas de 300 clínicas en todo el Perú</p>
  <Grid container item xs={1}>
  </Grid>
  </Grid>
  <Grid container item xs={1}>
    <Formik
      initialValues={initialValues}
      onSubmit={values => {
        onSubmit(values);
      }}
    >
      {({ values }) => (              
        <Form>
			<div id="x" >
